member.example:
This sample shows how to call GetParametersAsync with required parameters and parse the result.

var credential = new AzureKeyCredential("<key>");
var client = new ResourceServiceClient(credential);

Response response = await client.GetParametersAsync(new RequestContext()).ConfigureAwait(false);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.ToString());

This sample shows how to call GetParameters with required parameters and parse the result.

